export default function home() {
	const navigationOptions = {
		//To hide the ActionBar/NavigationBar
		header: null,
	};




	return (
		<div>

			<ImageDiv>

				<Image src={background1} alt=""  />
				<Center>
				<h1>Shit about vr </h1></Center>

			</ImageDiv>


			<div>
			<Link to="/product">
    		<ButtonStyle type="button">Explore</ButtonStyle>
 			</Link>
			</div>
navigationOptions()
		</div>
	)
}
